import React from 'react'
import './css/Afterbooking.css'

function Afterbooking() {
    return (
        <div className="after__booking">
            {/* <h1>Table for booking</h1> */}

            <tr className="booking__table">
                <th>row1</th>
                <th>row2</th>
                <th>row3</th>
                <th>row4</th>
            </tr>
        </div>
    )
}

export default Afterbooking
